import React, { Component } from 'react';


class PersonDetailAlbum extends Component {

  render() {
    return (
      <div>
        {
          this.props.photos.map(pic =>{
            return (
              <div className="detailsSingleProfilePicContainer" key={pic.cover}>
                <img src={`Albums/${this.props.name}/${p.profile_pic}.jpeg`} className="detailProfilePic" alt=""/>
              </div>
            )
          })
        }
      </div>
    );
  }
}

export default PersonDetailAlbum;
